import React from "react";

const ContributeAmount = () => {
  return (
    <>
      <h2>Contribution Amount</h2>
      <form action="">
        <input
          type="text"
          name=""
          id=""
          placeholder="Enter Contribution Amount in Wei"
        />
        <button type="submit">Execute</button>
      </form>
    </>
  );
};

export default ContributeAmount;
